La géographie (du grec ancien γεωγραφία – geographia, composé de « η γη » (hê gê) (la Terre) et « γραφειν » (graphein) décrire, puis du latin geographia, littéralement traduit par « dessin de la Terre ») est une science centrée sur le présent, ayant pour objet la description de la Terre et en particulier l'étude des phénomènes physiques, biologiques et humains qui se produisent sur le globe terrestre, à un certain niveau d'abstraction relative qui s'y prête, pluridisciplinarité comprise voire transdisciplinarité en un certain sens. En effet Yves Lacoste disait : « La géographie ne sert pas seulement à faire de la géopolitique. Cela sert aussi, pour tout un chacun, à admirer davantage de beaux paysage, en comprenant mieux comment ils sont construits. » Le portail de l'information géographique du gouvernement du Québec définit la géographie comme « une science de la connaissance de l'aspect actuel, naturel et humain de la surface terrestre. Elle permet de comprendre l'organisation spatiale de phénomènes (physiques ou humains) qui se manifestent dans notre environnement et façonnent notre monde ». Elle se divise en trois branches principales : 
* géographie mathématique qui est la première à être apparue avec « l'étude des formes et des dimensions de la Terre » à travers la géodésie ; 
* géographie physique qui comprend des disciplines scientifiques intégrant les sciences naturelles ; 
* géographie humaine qui comprend des disciplines scientifiques intégrant les sciences humaines et sociales. Grâce aux progrès de l'astronomie et de l'astronautique, des formations sont maintenant connues ailleurs que sur cette planète, le terme est utilisé pour tous les objets célestes.
